sys_variable_value.value:
  (function execute(inputs, outputs) {
          // Only parse the response body if the status code is 200	
          if (inputs.status_code == '200' || inputs.status_code == '201'){

              // Parse the response_body input variable and save parsed object as responseBody
              var responseBody = JSON.parse(inputs.response_body);

            outputs.print_time_left= "N/A";
            outputs.est_print_time = "N/A";
			outputs.print_time = "N/A";
            outputs.percent_complete = "N/A";

            var estprintTimeSec = responseBody.job.estimatedPrintTime;
            var printTimeLeftSec = responseBody.progress.printTimeLeft;
            var printTimeSec = responseBody.progress.printTime;
            var percentComplete = responseBody.progress.completion;

            if (!isNaN(estprintTimeSec))
            {
              var g= new GlideDuration(estprintTimeSec*1000)
              outputs.est_print_time = g;
            }
              if (!isNaN(printTimeLeftSec))
            {
              var gd = new GlideDuration(printTimeLeftSec*1000)
              outputs.print_time_left = gd;
            }	
            if (!isNaN(printTimeSec))
            {
              var gd1 = new GlideDuration(printTimeSec*1000)
              outputs.print_time = gd1;
            }	
			if (!isNaN(percentComplete))
            {
				outputs.percent_complete = percentComplete;
            }

            // Map the parsed responseBody values to output variables
            outputs.file_name = responseBody.job.file.name;
            outputs.print_user = responseBody.job.user;
            outputs.printer_state = responseBody.state;
        }
  })(inputs, outputs);

